// import Navbar from './components/navbar';

// function App() {
//   return (

//     <div classname='background-img'>
//       <Navbar/>


//       <h1>welcome</h1>
//     </div>

//   );
// }

// export default App;

import React, { useState } from "react";

// LandingPage.js — Landing page for OTT platform (React + Tailwind CSS)

function LandingPage() {
  const [email, setEmail] = useState("");

  return (
    <div className="min-h-screen bg-slate-950 text-white flex flex-col">
      {/* Hero Section */}
      <section className="relative flex-1 flex flex-col items-center justify-center text-center px-6 py-20 bg-gradient-to-b from-slate-900 to-slate-950">
        <h1 className="text-4xl md:text-6xl font-extrabold tracking-tight mb-6">
          Unlimited Movies, TV Shows & More
        </h1>
        <p className="text-lg md:text-xl text-slate-300 mb-8">
          Watch anywhere. Cancel anytime.
        </p>

        <div className="max-w-lg w-full">
          <p className="mb-4 text-slate-200">Ready to watch? Enter your email to create or restart your membership.</p>
          <div className="flex flex-col sm:flex-row gap-3">
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="Email address"
              className="flex-1 px-4 py-3 rounded-md text-black focus:outline-none"
            />
            <button className="bg-red-600 hover:bg-red-700 px-6 py-3 rounded-md font-semibold">
              Get Started →
            </button>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="bg-slate-900 py-16 px-6">
        <div className="max-w-6xl mx-auto grid md:grid-cols-2 gap-12 items-center">
          <div>
            <h2 className="text-3xl font-bold mb-4">Enjoy on your TV</h2>
            <p className="text-slate-300 mb-6">
              Watch on smart TVs, PlayStation, Xbox, Chromecast, Apple TV, Blu-ray players and more.
            </p>
          </div>
          <div>
            <img
              src="https://picsum.photos/seed/tv/800/450"
              alt="TV demo"
              className="rounded-xl shadow-lg"
            />
          </div>
        </div>
      </section>

      {/* Download Feature */}
      <section className="bg-slate-950 py-16 px-6">
        <div className="max-w-6xl mx-auto grid md:grid-cols-2 gap-12 items-center">
          <div className="order-2 md:order-1">
            <img
              src="https://picsum.photos/seed/mobile/800/450"
              alt="Mobile demo"
              className="rounded-xl shadow-lg"
            />
          </div>
          <div className="order-1 md:order-2">
            <h2 className="text-3xl font-bold mb-4">Download your shows to watch offline</h2>
            <p className="text-slate-300 mb-6">
              Save your favourites easily and always have something to watch.
            </p>
          </div>
        </div>
      </section>

      {/* FAQ Section */}
      <section className="bg-slate-900 py-16 px-6">
        <div className="max-w-3xl mx-auto text-center">
          <h2 className="text-3xl font-bold mb-6">Frequently Asked Questions</h2>
          <div className="space-y-4 text-left">
            {[
              { q: "What is OttoStream?", a: "OttoStream is an OTT streaming platform for movies and shows." },
              { q: "How much does it cost?", a: "Plans start at just $9.99 per month." },
              { q: "Can I cancel anytime?", a: "Yes, you can cancel anytime without fees." },
            ].map((faq, i) => (
              <div key={i} className="bg-slate-800 rounded-lg p-4">
                <p className="font-semibold">{faq.q}</p>
                <p className="text-slate-300 mt-1">{faq.a}</p>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="bg-slate-950 py-10 text-center text-slate-400 text-sm">
        © 2025 OttoStream. All rights reserved.
      </footer>
    </div>
  );
}

export default LandingPage;
